import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input field
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });

    // Define and type the XSS payload
    const xssPayload = "<script>alert('XSS')</script>";
    await searchInput.fill(xssPayload);

    // Take a screenshot after entering the payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Locate and click the search button
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // Take a final screenshot after clicking search
    // Playwright auto-dismisses alerts, so we don't need to handle them.
    await page.waitForLoadState('domcontentloaded');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract the value from the input to verify the action
    const enteredValue = await searchInput.inputValue();

    return {
      success: true,
      action: "Attempted to inject an XSS payload into the search input and submitted the search.",
      extractedData: {
        payloadUsed: xssPayload,
        inputValueAfterAction: enteredValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via Search Input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
